an otot bantu nafas menurun, Nafas megap-megap (gasping menurun), Frekuensi nafas membaik, Nilai Gas Darah Arteri membaik, Upaya nafas membaik, Auskultasi suara inspirasi membaik; Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapkan status menyusui membaik dengan kriteria hasil: Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun, Berat Badan Bayi Meningkat.', '', '', '', '', '', '', '', '', '1679', '1', '<b>Intervensi Keperawatan: </b>Periksa indikasi ventilator mekanik (mis:kelelahan, otot nafas, disfungsi neurologis, asidosis respiratorik), Monitor efek ventilator terhadap status oksigenasi (mis: bunyi paru, X ray paru, AGD, Sa O2, SvO2, ETCO2, respon), Atur posisi kepala 45-30 untuk mencegah aspirasi, Reposisi pasien setiap 2 jam jika perlu, Lakukan perawatan mulut secara rutin, termasuk sikat gigi setiap 12 jam, Lakukan penghisapan lendir sesuai kebutuhan, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu<div><b>Kolaborasi:</b> post tranfusi PRC 20 cc tgl 04/04/25 selesai jam 16.00 WIB, weaning FiO2 dan PIP bertahap jika kondisi stabil (selang seling cpap dalam)--&gt; jika perburukan back to Pressure SIMV, rencana cek SHK (19/4/25) kertas saring belum diambil, follow up expertise babygram (11/4/25) dan (12/4/25), rencana ekstubasi tunggu kondisi stabil --&gt; premed dexametason 0,25 mg diberikan 4 jam sebelum ekstubasi dan inhalasi epinephrine 1 ampul (1 jam sebelum dan sesudah extubasi) dan hubungi keluarga sebelum extubasi sementara tunda..</div><div><br></div>', NULL, '1679', 0, NULL, '2025-04-13 06:37:42')
